import React from 'react'
import './asset/main.scss'
import Status from './components/Status'

class App extends React.Component {
  constructor() {
    super()
    this.state = {
      value:''
    }
  }
  addStatus = (value) => {
    this.setState({
      value: value
    })
    alert(this.state.value)
  }

  render() {
    return (
      <div>
        <Status addStatus = {this.addStatus} />
      </div>
    )
  }
}

export default App
